import React, { useEffect, useState } from "react";
import { WeatherCard } from "./components/WeatherCard";
import { Footer } from "./components/Footer";
import { TodayWeatherCard } from "./components/TodayWeatherCard";
import { GetWeahterData, WeatherData } from "./api/WeatherApi";

function App() {
  //useEffect(() => {//isviekcia api call ir nusettina state}, []);
  // Isivykdo kai komponentas yra uzkraunamas arba kai state yra pakeiciamas
  //

  const [weatherData, setWeatherData] = useState<WeatherData | null>();
  const [weatherArrayTimeIndex, setWeatherArrayTimeIndex] = useState<number>(0);
  const [weatherArrayDateIndex, setWeatherArrayDateIndex] = useState<number>(0);
  const [weatherDate, setWeatherDate] = useState<string>("");
  const [finalDate, setFinalDate] = useState<string>("");
  const [weeklyWeatherArray, setWeeklyWeatherArray] = useState<number[]>([]);

  useEffect(() => {
    const fetchData = async () => {
      let response = await GetWeahterData();
      setWeatherData(response);
    };
    let dateToday: string;
    let today = new Date();
    let timeNow = today.getHours();
    setWeatherArrayTimeIndex(timeNow - 1);

    dateToday =
      today.getFullYear() +
      "-0" +
      (today.getMonth() + 1) +
      "-" +
      today.getDate() +
      "T12:00";

    setWeatherArrayDateIndex(weatherData?.hourly.time.indexOf(dateToday) ?? 0);

    setWeatherDate(weatherData?.hourly.time[weatherArrayDateIndex] ?? "00-00");

    // for (let i = weatherArrayDateIndex; i < weatherArrayDateIndex + 6; i++) {}
    console.log(weatherArrayDateIndex);
    let myIndexArray: number[] = [];
    myIndexArray.push(weatherArrayDateIndex);
    myIndexArray.push(weatherArrayDateIndex + 1);
    myIndexArray.push(weatherArrayDateIndex + 2);
    myIndexArray.push(weatherArrayDateIndex + 3);
    myIndexArray.push(weatherArrayDateIndex + 4);
    myIndexArray.push(weatherArrayDateIndex + 5);
    console.log(weatherData);

    setWeeklyWeatherArray(myIndexArray ?? 0);
    console.log(myIndexArray);

    let preFormatedDate = weatherDate.split("T")[0];
    setFinalDate(preFormatedDate.split("2023-")[1]);

    console.log(finalDate);

    fetchData();
  }, []);

  return (
    <>
      <TodayWeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayTimeIndex] ?? 0
        }
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 24] ?? 0
        }
        date={weatherData?.hourly.time[weeklyWeatherArray[0]] ?? ""}
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 48] ?? 0
        }
        date={weatherData?.hourly.time[weeklyWeatherArray[1]] ?? ""}
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 96] ?? 0
        }
        date={weatherData?.hourly.time[weeklyWeatherArray[2]] ?? ""}
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 120] ?? 0
        }
        date={weatherData?.hourly.time[weeklyWeatherArray[3]] ?? ""}
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 144] ?? 0
        }
        date={weatherData?.hourly.time[weeklyWeatherArray[4]] ?? ""}
      />
      <WeatherCard
        temperature={
          weatherData?.hourly.temperature_2m[weatherArrayDateIndex + 168] ?? 0
        }
        date={weatherData?.hourly.time[weeklyWeatherArray[5]] ?? ""}
      />
      <Footer />
    </>
  );
}

export default App;
